import React from 'react'
import './Main.css'

const Header = () => {
  return (
    <div className='headercontainer'>
       <div className='menu'>
       position: absolute;
width: 10.94px;
height: 10.94px;
left: 59px;
top: 41.06px;

background: #470086;
       <div className='logo'>Brand Name</div>
        <div>
            <ul className='list'>
                <li className='sublist'>Our Services</li>
                <li className='sublist'>Bridal</li>
                <li className='sublist'>About Us</li>
                <li className='sublist'>Blog</li>
                <li className='sublist offer'>Offers</li>
            </ul>
        </div>
       </div>
    </div>
  )
}

export default Header
